import React, {useEffect, useState} from 'react';
import Grid from '@material-ui/core/Grid';
import Icon from '@material-ui/core/Icon';
import Button from '@material-ui/core/Button';
import Tooltip from '@material-ui/core/Tooltip';
import {useApiRequest} from '../../../hooks';

export function TagsSections() {
  const [categories, setCategories] = useState([]);
  const {getRequest} = useApiRequest();

  useEffect(() => {
    const getData = async () => {
      const data = await getRequest('service-type/top');
      setCategories([...data]);
      console.log('top ',data);
    };
    getData();
  }, []);
  return (
    <Grid 
      container
      alignItems='center' 
      justifyContent='center'
      className='tags-container'  
    >
      <Grid item xs={6} sm={6} align='left'>
        { categories.map(categorie => (
        <Tooltip title={categorie?.name ?? 'Dato invalido'}>
          <Icon className='search-icons'>{categorie?.icon ?? 'start'}</Icon>
        </Tooltip>))
        }
      </Grid>
      <Grid item xs={4} sm={4} align='right'>
        <Button variant="contained" color='primary' className='search-button'>
          Primary
        </Button> 
      </Grid>
    </Grid>
  );
};
